import { NavLink } from "react-router-dom";

export default function Navbar() {
  return (
    <nav className="flex justify-between h-16 p-2 drop-shadow">
      <div className="container flex">
        <NavLink
          className={({ isActive, isPending }) => {
            if (isActive) {
              return "text-lg underline underline-offset-2 font-bold mx-4";
            } else {
              return "text-lg mx-4";
            }
          }}
          to="/"
        >
          Home
        </NavLink>
        <NavLink
          className={({ isActive, isPending }) => {
            if (isActive) {
              return "text-lg underline underline-offset-2 font-bold mx-4";
            } else {
              return "text-lg mx-4";
            }
          }}
          to="/categories"
        >
          Categories
        </NavLink>
      </div>
    </nav>
  );
}
